import "../components/header.css"
import logo from '../logo1.svg';


function Header() {
    return (
      <header className="App-header">
          <Logo />
          <NavBar />
      </header>
    )
  }

  function Logo () {
    return (
      <div className="logo"> 
        <img src={logo} className="App-logo" alt="logo" />
        <span className="App-logo-tag"> Your Logo here </span>
      </div>
    )
  }

  function NavBar() {
    return (
      <nav>
        <ul>
          <li>About</li>
          <li> Home</li>
          <li> Comtacts</li>
        </ul>
      </nav>
    )
  }
export default Header
